import React, { useState } from 'react';
import './App.css';

interface Note {
  id: number;
  title: string;
  content: string;
  label: string;
  isFavorite: boolean;
}

const App: React.FC = () => {
  const [notes, setNotes] = useState<Note[]>([]);
  const [title, setTitle] = useState('');
  const [content, setContent] = useState('');
  const [label, setLabel] = useState('');
  const [editingNoteId, setEditingNoteId] = useState<number | null>(null);

  const handleCreateNote = () => {
    if (!title || !content || !label) return; // Basic validation
    const newNote: Note = {
      id: Date.now(),
      title,
      content,
      label,
      isFavorite: false,
    };
    setNotes([...notes, newNote]);
    setTitle('');
    setContent('');
    setLabel('');
  };

  const toggleFavorite = (id: number) => {
    setNotes(notes.map(note =>
      note.id === id ? { ...note, isFavorite: !note.isFavorite } : note
    ));
  };

  const handleDeleteNote = (id: number) => {
    setNotes(notes.filter(note => note.id !== id));
  };

  const handleEditNote = (id: number) => {
    setEditingNoteId(id);
  };

  const handleSaveNote = (id: number, newTitle: string, newContent: string) => {
    setNotes(notes.map(note =>
      note.id === id ? { ...note, title: newTitle, content: newContent } : note
    ));
    setEditingNoteId(null); // Exit edit mode
  };

  return (
    <div className="app-container">
      <div className="note-form">
        <input
          type="text"
          placeholder="Note Title"
          value={title}
          onChange={(e) => setTitle(e.target.value)}
        />
        <textarea
          placeholder="Note Content"
          value={content}
          onChange={(e) => setContent(e.target.value)}
        />
        <select value={label} onChange={(e) => setLabel(e.target.value)}>
          <option value="">--Select your label--</option>
          <option value="personal">Personal</option>
          <option value="work">Work</option>
          <option value="study">Study</option>
          <option value="other">Other</option>
        </select>
        <button onClick={handleCreateNote}>Create Note</button>
      </div>

      <div className="notes-grid">
        {notes.map(note => (
          <div key={note.id} className="note-item">
            {editingNoteId === note.id ? (
              <>
                <input
                  type="text"
                  defaultValue={note.title}
                  onChange={(e) => note.title = e.target.value}
                />
                <textarea
                  defaultValue={note.content}
                  onChange={(e) => note.content = e.target.value}
                />
                <button onClick={() => handleSaveNote(note.id, note.title, note.content)}>Save</button>
                <button onClick={() => setEditingNoteId(null)}>Cancel</button>
              </>
            ) : (
              <>
                <div className="note-header">
                  <h3>{note.title}</h3>
                  <button
                    className={`favorite-btn ${note.isFavorite ? 'favorited' : ''}`}
                    onClick={() => toggleFavorite(note.id)}
                  >
                    &#x2764;
                  </button>
                  <button className="delete-btn" onClick={() => handleDeleteNote(note.id)}>x</button>
                </div>
                <p>{note.content}</p>
                <small>{note.label}</small>
                <button onClick={() => handleEditNote(note.id)}>Edit</button>
              </>
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

export default App;
